import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { NavLink } from 'react-router-dom';
import classes from './dashboard.module.css';
import image1 from '../assets/image1.png';
import clock from '../assets/clock.png';
import location from '../assets/location.png';







function Dashboard() {


    return (
        <div className={classes.dashboard}>
            <div>
                <h1 className={classes.title}>Dashboard</h1>
                <div>
                    <img src="ht" alt=" " className={classes.icon} />
                    <img src="ht" alt="" className={classes.icon} />
                </div>
            </div>
            <div >
                <div>
                    <input type="text" placeholder="Search" className={classes.search} />
                </div>
                <div>=</div>
            </div>
            <div className={classes.eventContainer}>

            <div className={classes.event}>
                <img src={image1} alt="" className={classes.image} />
                <div className={classes.eventDetails}>
                    <p>African Food Festival</p>
                    <div className={classes.location}>
                        <img src={location} alt="" className={classes.icon} />
                        <p>Kent, United Kingdom</p>
                    </div>
                    <div className={classes.date}>
                        <img src={clock} alt="" className={classes.icon} />
                        <p>April 26th10:00 AM - 12:00 PM</p>
                    </div>
                </div>

            </div>
            </div>

        </div>

       );
}

export default Dashboard;
